style.css:
@-moz-document domain(labs.openai.com) {


.collection-page-image {
    display: inline;
}

.collection-page-images.pagination {
    width: 100%;
}

.collection-page-images .pagination-content {
    grid-template-columns: repeat(auto-fit, 200px);
    justify-content: center;
}

.pagination-controls {
text-align:center;
}

}
